(function(){var loadHandler=window['sl_{18DE6108-0EA5-469B-9224-CABD79A3332F}'];loadHandler&&loadHandler(5, '<div id="spr0_9981a35"><div id="spr1_9981a35" class="kern slide"><img id="img3_9981a35" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_9981a35" style="left:986.15px;top:648.5px;"><div id="spr4_9981a35"><img id="img0_9981a35" src="data:image/png;base64," width="273.75" height="62.25" alt="" style="left:0.06px;top:-0.094px;"/></div></div></div><div id="spr2_9981a35" class="kern slide"><div id="svg0_9981a35" style="left:1069.508px;top:667.862px;"><svg width="180" height="38" viewBox="0 0 180 38"><path fill="#c6baec" d="M0,0 h179.634 v37.44 h-179.634 Z"/></svg></div><div id="spr5_9981a35" style="left:1069.508px;top:667.862px;"><div style="width:0px;"><span id="txt0_9981a35" class="nokern relpos" data-width="75.858070" style="left:15.067px;top:1.931px;">Book D  </span> <span id="txt1_9981a35" class="nokern relpos" data-width="73.511719" style="left:15.061px;top:1.931px;">Page 18</span></div></div><div id="spr6_9981a35" style="left:95.724px;top:8.886px;"><div id="spr7_9981a35"><img id="img1_9981a35" src="data:image/png;base64," width="914.25" height="53.25" alt="" style="left:-0.097px;top:-0.054px;"/></div></div><div id="spr8_9981a35" style="left:83.428px;top:61.992px;"><div style="width:0px;"><span id="txt2_9981a35" class="nokern" data-width="127.854172" style="left:9.6px;top:3.453px;">Succession</span></div><div style="width:0px;"><span id="txt3_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:48.485px;">•</span> <span id="txt4_9981a35" class="nokern relpos" data-width="738.404297" style="left:31.664px;top:44.915px;">Sequential change in populations over time in an given area as a result of </span> <span id="txt5_9981a35" class="nokern relpos" data-width="136.132812" style="left:31.658px;top:44.915px;">interspecific </span> <span id="txt6_9981a35" class="nokern relpos" data-width="125.817703" style="left:31.651px;top:44.915px;">competition.</span></div><div style="width:0px;"><span id="txt7_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:86.158px;">•</span> <span id="txt8_9981a35" class="nokern relpos" data-width="932.022766" style="left:31.664px;top:82.589px;">Mixtures of populations that define communities may change over time or remain as a climax</span></div><div style="width:0px;"><span id="txt9_9981a35" class="nokern" data-width="117.505859" style="left:39.6px;top:113.595px;">community.</span></div><div style="width:0px;"><span id="txt10_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:154.838px;">•</span> <span id="txt11_9981a35" class="nokern relpos" data-width="639.713501" style="left:31.664px;top:151.269px;">Gradual, orderly changes in the vegetation (and animals), called </span> <span id="txt12_9981a35" class="nokern relpos" data-width="120.811569" style="left:31.658px;top:151.269px;">seral stages</span> <span id="txt13_9981a35" class="nokern relpos" data-width="157.814453" style="left:31.651px;top:151.269px;">, of an area as it</span></div><div style="width:0px;"><span id="txt14_9981a35" class="nokern relpos" data-width="505.174469" style="left:39.6px;top:182.275px;">develops toward a final stable community called a </span> <span id="txt15_9981a35" class="nokern relpos" data-width="196.750641" style="left:39.593px;top:182.275px;">climax community</span> <span id="txt16_9981a35" class="nokern relpos" style="left:39.587px;top:182.275px;">.</span></div><div style="width:0px;"><span id="txt17_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:223.518px;">•</span> <span id="txt18_9981a35" class="nokern relpos" data-width="912.820312" style="left:31.664px;top:219.949px;">Disturbances produce new habitats, which lead to immigration of new species. This leads to</span></div><div style="width:0px;"><span id="txt19_9981a35" class="nokern" data-width="828.218750" style="left:39.6px;top:250.955px;">colonization and competition producing a change in the character of a community.</span></div><div style="width:0px;"><span id="txt20_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:292.198px;">•</span> <span id="txt21_9981a35" class="nokern relpos" data-width="447.445312" style="left:31.664px;top:288.629px;">The first species to appear is referred to as a </span> <span id="txt22_9981a35" class="nokern relpos" data-width="163.713531" style="left:31.658px;top:288.629px;">pioneer species</span> <span id="txt23_9981a35" class="nokern relpos" style="left:31.651px;top:288.629px;">.</span></div></div><div id="spr9_9981a35" style="left:83.428px;top:407.712px;"><div style="width:0px;"><span id="txt24_9981a35" class="nokern" data-width="363.629547" style="left:9.6px;top:2.408px;">There are two types of succession:</span></div><div style="width:0px;"><span id="txt25_9981a35" class="nokern" data-width="253.605469" style="left:9.6px;top:37.326px;">1. Primary succession</span></div><div style="width:0px;"><span id="txt26_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:78.244px;">•</span> <span id="txt27_9981a35" class="nokern relpos" data-width="365.975891" style="left:31.664px;top:74.675px;">Occurs in an area that does not have</span></div><div style="width:0px;"><span id="txt28_9981a35" class="nokern" data-width="357.420563" style="left:39.6px;top:101.875px;">any remains of a climax community.</span></div><div style="width:0px;"><span id="txt29_9981a35" class="nokern relpos" data-width="62.089844" style="left:9.6px;top:129.075px;">          </span> <span id="txt30_9981a35" class="nokern relpos" data-width="131.558304" style="left:9.593px;top:129.075px;">Ex: bare rock</span></div><div style="width:0px;"><span id="txt31_9981a35" class="nokern relpos" dir="auto" style="left:9.6px;top:166.511px;">•</span> <span id="txt32_9981a35" class="nokern relpos" data-width="341.759766" style="left:31.664px;top:162.941px;">Pioneer species usually create soil.</span></div><div style="width:0px;"><span id="txt33_9981a35" class="nokern relpos" data-width="62.089844" style="left:9.6px;top:190.141px;">          </span> <span id="txt34_9981a35" class="nokern relpos" data-width="354.959991" style="left:9.593px;top:190.141px;">Ex: volcanic island, land exposed by</span></div><div style="width:0px;"><span id="txt35_9981a35" class="nokern relpos" data-width="107.253616" style="left:9.6px;top:217.341px;">                </span> <span id="txt36_9981a35" class="nokern relpos" data-width="193.747757" style="left:9.593px;top:217.341px;">a retreating glacier</span> <span id="txt37_9981a35" class="nokern relpos" style="left:9.587px;top:217.341px;">.</span></div></div><div id="spr10_9981a35" style="left:586.857px;top:399.12px;"><div id="spr11_9981a35"><img id="img2_9981a35" src="data:image/jpeg;base64," width="676.5" height="258.75" alt="" style="left:0.012px;top:0.061px;"/></div></div><div id="spr12_9981a35" style="left:1223.841px;top:3.386px;"><div id="svg1_9981a35" style="left:4.59px;top:1.636px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg2_9981a35" style="left:0px;top:0px;"><svg width="56" height="32" viewBox="0 0 56 32"><path fill="none" d="M0,0 h55.259 v31.5 h-55.259 Z"/></svg></div><div id="spr13_9981a35"><div style="width:0px;"><span id="txt38_9981a35" class="nokern" data-width="42.155083" style="left:9.598px;top:0.163px;">END</span></div></div></div></div></div>', '{"s":[]}');})();